import React from 'react'

export default class LeagueButton extends React.Component {

    handleClick() {
        alert(this.props.league + ' clicked');
    }

    render() {
        return(
            <div className='league-button' onclick={handleClick}>
                {this.props.league}
            </div>
        )
    }
}
